import React, {useEffect, useState} from "react";
import {Card, Container} from "semantic-ui-react";
import API from "../../api";

function FeedbackList() {
  const [feedbackList, setFeedbackList] = useState({attributes: []});

  useEffect(async () => {
    API.get("/feedbacks")
      .then((response) => {
        console.log("feedback list", response);
        setFeedbackList({attributes: response.data.data});
      })
      .catch((error) => {
        console.error("error", error);
      });
  });

  return (
    <Container className='main-container'>
      {feedbackList.attributes.map((feedback) => (
        <Card>
          <Card.Content header={feedback.body}/>
        </Card>
      ))}
    </Container>
  );
}

export default FeedbackList;
